function box(){
    return(
<div class="container2">
        <li className="box1" data-slick-index="0" aria-hidden="false" style="width: 317px;">
            <a class="channeltiles__link" href="#">
                 <img src={IMAGE1} className="IMAGE1"alt="Mercedes Benz Logo" /></a>
        </li>
        <li className="box1" data-slick-index="0" aria-hidden="false" style="width: 317px;">
            <a class="channeltiles__link" href="#">
                 <img src={IMAGE2} className="IMAGE2"alt="Mercedes Benz Logo" /></a>
        </li>
        <li className="box1" data-slick-index="0" aria-hidden="false" style="width: 317px;">
            <a class="channeltiles__link" href="#">
                 <img src={IMAGE3} className="IMAGE3"alt="Mercedes Benz Logo" /></a>
        </li>
        </div>
);
}
export default box;
